import React from 'react';

const Card = (props) => {
  return (
    <div className='card bg-dark text-white'>
      <img
        src={props.imageUrl}
        className='card-img'
        alt={`${props.name} card`}
      />
      <div className='card-img-overlay'>
        <h5 className='card-title'>{props.name}</h5>
        <p className='card-text'>HOLA</p>
      </div>
    </div>
  );
};

export default Card;
